const _SCOPES = const [SpeechApi.CloudPlatformScope];


Future<Map<String, Object>> speechToText(String uri, String language) async {
  print("uri : $uri in language $language");
  File file = File(uri);
  List<String> s = await file.readAsLines();
  print("S>> $s");
  List<int> fileBytes = file.readAsBytesSync();
  print("fileBytes $fileBytes");
  String fileBase64 = base64Encode(fileBytes);
  print("fileBase64 $fileBase64");
  var httpClient = await clientViaServiceAccount(_credentials, _SCOPES);
  var speech = new SpeechApi(httpClient);
  final _json = {
    "audio":{
      "content": fileBase64
//        "uri": uri
//        "content":""
    },
    "config": {
      "encoding": "AMR",
      "sampleRateHertz": 8000,
      "languageCode": language,
    }
  };
  final _recognizeRequest = RecognizeRequest.fromJson(_json);
  RecognizeResponse response = await speech.speech.recognize(_recognizeRequest);
  print("response.results ${response.results}");
  if(response!=null){
    for (SpeechRecognitionResult result in response.results) {
      print("result.toJson() ${result.toJson()}");
      return result.toJson();
    }
  }
  return null;
}